import './App.css';
import React from 'react';
import { ThemeProvider } from './theme/ThemeContext';
import Header from './theme/Header';
import ToggleThem from './theme/ToggleThem';
function App() {
  return (
    <div>
      <ThemeProvider>
        <Header/>
        <ToggleThem/>
      </ThemeProvider>
    </div>
  );
}

export default App;
